import React from 'react'

export default function Header() {
    return (
        <div className="header-wrapper">
        <div className="text-wrapper">
            <p><span>---</span><span>Your</span><span>Personal</span><span>Recipes</span><span>---</span></p><br/>

        </div>
        <div className="text-sub"><h5>Manage your own recipe collections</h5></div>


        </div>
    )
}
